def solver_single(cyc1, cyc2, idx):
    hit, cyc = 0, 0
    target = cyc2[idx - 1]
    cur = idx
    for i in range(313):
        cur = cyc1[cur - 1]
        if cur == target:
            hit = i + 1
        if cur == idx:
            cyc = i + 1
            return hit, cyc

def solver(cyc1, cyc2):
    # f^x(i) = g(i)
    u, v = 0, 1
    for i in range(1, 313 + 1):
        deg, cyc = solver_single(cyc1, cyc2, i)
        u = crt(u, deg, v, cyc)
        v = LCM(v, cyc)
    return u, v


